from aiogram import Bot, Dispatcher, F
from aiogram.types import Message
from aiogram.filters import CommandStart, Command
import os
import asyncio

bot = Bot(token="Token")
dp = Dispatcher()

@dp.message(CommandStart())
async def Comm(message:Message):
    await message.reply("Hello! Я учебный бот")


@dp.message(Command('help'))
async def name(message:Message):
    await message.reply('я умею отвечать на команды и текст!')

@dp.message(Command('info'))
async def namde(message:Message):
    await message.reply('python + tg bot + sqlite')

@dp.message(Command('contact'))
async def namded(message:Message):
    await message.reply_contact(phone_number='757575', first_name='IvAS', last_name='Ivanov')

@dp.message(Command('location'))
async def cnamde(message:Message):
    await message.reply_location(longitude='42.904041105577875', latitude='74.68527398696746')

#################################################################################################

@dp.message(F.text.lower() == 'привет')
async def photos(message:Message):
    await message.reply('ПРивет как дела?')


@dp.message(F.text.lower() == 'Курс')
async def Bye(message:Message):
    await message.reply("курс длится 3 мес")


@dp.message(F.text.lower() == 'Курс')
async def Bye(message:Message):
    await message.reply_photo(photo="data:image/jpeg;base64,")


async def main():
    await dp.start_polling(bot)
                                   # Нужно завопнить вот эти 4 блока
asyncio.run(main())



































































